import React from 'react';
import Tilt from 'react-tilt';
import brain from './brain.png'
const Logo = () => {
    return (
        <div className='mt0 ma4'>
            <Tilt className="Tilt" 
                options={{ max: 25 }} 
                style={{ height: 250, width: 250 }} >
                <div className="Tilt-inner"> 
                {brain}
                 </div>
            </Tilt>
        </div>
    );
}

export default Logo;
